import Link from 'next/link';

const Header: React.FunctionComponent = () => (
  <div>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/about">
      <a>About</a>
    </Link>
    <style jsx>
      {`
        a {
          font-family: 'Lato', sans-serif;
          margin-right: 15px;
        }
      `}
    </style>
  </div>
);

export default Header;
